/**
 * Embedded audio assets for mock TTS
 * Generated from test-assets/audio/*.wav files
 * 
 * Run this command to regenerate:
 * node -e "$(cat scripts/generate-mock-audio-assets.js)"
 */
export const MOCK_AUDIO_ASSETS = {
  "feedback1": {
    "base64": "",
    "size": 181050,
    "originalName": "feedback1.wav"
  },
  "feedback2": {
    "base64": "",
    "size": 152250,
    "originalName": "feedback2.wav"
  },
  "feedback3": {
    "base64": "",
    "size": 184890,
    "originalName": "feedback3.wav"
  }
} as const;

export type MockAudioAsset = keyof typeof MOCK_AUDIO_ASSETS;

/**
 * Get audio bytes for a mock asset
 */
export function getMockAudioBytes(assetName: MockAudioAsset): Uint8Array {
  const asset = MOCK_AUDIO_ASSETS[assetName];
  const binaryString = atob(asset.base64);
  const bytes = new Uint8Array(binaryString.length);
  for (let i = 0; i < binaryString.length; i++) {
    bytes[i] = binaryString.charCodeAt(i);
  }
  return bytes;
}

/**
 * Get all available mock audio assets
 */
export function getAvailableMockAssets(): MockAudioAsset[] {
  return Object.keys(MOCK_AUDIO_ASSETS) as MockAudioAsset[];
}
